import React from 'react';
import {
    StyleSheet,
    Text,
    View,
    TouchableOpacity,
    Image,
} from 'react-native';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { useEffect, useState } from 'react';
import { Cache } from "react-native-cache";

export default function SearchContent() {
    return(
    <View>
     <Text>Search</Text> 
    </View>);
}
